import "../styles/homeStyles/home.scss";
import {FaLinkedin} from "react-icons/fa";
import {FaGithub} from "react-icons/fa";
import { QRCode } from 'react-qrcode-logo';

const Home = () => {
    
    return (
        <div className="home">
            <img src = {require("../images/homeImage.jpg")}/>
            <div className="socialMedia">
               <div className="gitLinkdin">
                    <a href="https://github.com/AznivDev" target="blank"><FaGithub className="github"/></a>
                    <a href="https://www.linkedin.com/in/azniv-saroyan/" target="_blank"><FaLinkedin className="linkedin"/></a>
                    <QRCode value="https://github.com/AznivDev" size= {70} 
                                                           bgColor= {"#0A66C2"}
                                                        //    fgColor = {"green"}
                                                           imageSettings={{
                                                            src: "../images/nodejs_img.jpg",
                                                            x: null,
                                                            y: null,
                                                            height: 24,
                                                            width: 24,
                                                            excavate: true,
                                                          }}
                                                           className="grcode" />
               </div>
            </div>      
        </div>
    )
}

export default Home;
